import classes from './MyPosts.module.css';

const MyPosts = () =>{
    return(
            <div>
                my posts
                <div>
                    <textarea></textarea>
                    <button>Add post</button>
                </div>
                <div className={classes.posts}>
                    <div className={classes.item}>post1</div>
                    <div className={classes.item}>post2</div>
                </div>
            </div>
    );
}

export default  MyPosts;
